INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (11, 5, 1, 'admin', 'CLTPHP4.3版本更新', 'CLTPHP4.3版本更新,CLTPHP,CLTPHP内容管理系统', 'CLTPHP4.3版本更新,CLTPHP,CLTPHP内容管理系统', '<p>更新内容</p><p>1.后台模型建立重构</p><p>2.新增文件上传</p><p>3.更改标题样式和缩略图数据库存放方式</p><p>4.后台文章栏目标题样式添加</p><p>5.修改部分bug，删减了系统冗余内容</p><p><strong><em>注意：本次修改重构了模型，4.2及以前版本不可直接覆盖代码</em></strong></p><p>推荐环境：apache2.4+php5.5(以上)+mysql5.0(以上)</p><p>开发环境：phpStudy 2016 &nbsp;php5.5.38</p>', '0', 0, '1', 0, '', 0, 0, 807, 1499828638, 1505264287, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
