INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (15, 6, 1, 'admin', 'CLTPHP字符串截取', 'CLTPHP字符串截取', 'CLTPHP字符串截取', '<pre><span>//字符串截取<br></span><span>function </span><span>str_cut</span><span>(</span><span>$sourcestr</span><span>,</span><span>$cutlength</span><span>,</span><span>$suffix</span><span>=</span><span>\'...\'</span><span>)<br></span><span>{<br></span><span>    </span><span>$returnstr</span><span>=</span><span>\'\'</span><span>;<br></span><span>    </span><span>$i</span><span>=</span><span>0</span><span>;<br></span><span>    </span><span>$n</span><span>=</span><span>0</span><span>;<br></span><span>    </span><span>$str_length</span><span>=strlen(</span><span>$sourcestr</span><span>)</span><span>;</span><span>//字符串的字节数<br></span><span>    </span><span>while </span><span>((</span><span>$n</span><span>&lt;</span><span>$cutlength</span><span>) </span><span>and </span><span>(</span><span>$i</span><span>&lt;=</span><span>$str_length</span><span>))<br></span><span>    {<br></span><span>        </span><span>$temp_str</span><span>=substr(</span><span>$sourcestr</span><span>,</span><span>$i</span><span>,</span><span>1</span><span>)</span><span>;<br></span><span>        </span><span>$ascnum</span><span>=Ord(</span><span>$temp_str</span><span>)</span><span>;</span><span>//得到字符串中第$i位字符的ascii码<br></span><span>        </span><span>if </span><span>(</span><span>$ascnum</span><span>&gt;=</span><span>224</span><span>)    </span><span>//如果ASCII位高与224，<br></span><span>        </span><span>{<br></span><span>            </span><span>$returnstr</span><span>=</span><span>$returnstr</span><span>.substr(</span><span>$sourcestr</span><span>,</span><span>$i</span><span>,</span><span>3</span><span>)</span><span>; </span><span>//根据UTF-8编码规范，将3个连续的字符计为单个字符<br></span><span>            </span><span>$i</span><span>=</span><span>$i</span><span>+</span><span>3</span><span>;            </span><span>//实际Byte计为3<br></span><span>            </span><span>$n</span><span>++</span><span>;            </span><span>//字串长度计1<br></span><span>        </span><span>}<br></span><span>        </span><span>elseif </span><span>(</span><span>$ascnum</span><span>&gt;=</span><span>192</span><span>) </span><span>//如果ASCII位高与192，<br></span><span>        </span><span>{<br></span><span>            </span><span>$returnstr</span><span>=</span><span>$returnstr</span><span>.substr(</span><span>$sourcestr</span><span>,</span><span>$i</span><span>,</span><span>2</span><span>)</span><span>; </span><span>//根据UTF-8编码规范，将2个连续的字符计为单个字符<br></span><span>            </span><span>$i</span><span>=</span><span>$i</span><span>+</span><span>2</span><span>;            </span><span>//实际Byte计为2<br></span><span>            </span><span>$n</span><span>++</span><span>;            </span><span>//字串长度计1<br></span><span>        </span><span>}<br></span><span>        </span><span>elseif </span><span>(</span><span>$ascnum</span><span>&gt;=</span><span>65 </span><span>&amp;&amp; </span><span>$ascnum</span><span>&lt;=</span><span>90</span><span>) </span><span>//如果是大写字母，<br></span><span>        </span><span>{<br></span><span>            </span><span>$returnstr</span><span>=</span><span>$returnstr</span><span>.substr(</span><span>$sourcestr</span><span>,</span><span>$i</span><span>,</span><span>1</span><span>)</span><span>;<br></span><span>            </span><span>$i</span><span>=</span><span>$i</span><span>+</span><span>1</span><span>;            </span><span>//实际的Byte数仍计1个<br></span><span>            </span><span>$n</span><span>++</span><span>;            </span><span>//但考虑整体美观，大写字母计成一个高位字符<br></span><span>        </span><span>}<br></span><span>        </span><span>else                </span><span>//其他情况下，包括小写字母和半角标点符号，<br></span><span>        </span><span>{<br></span><span>            </span><span>$returnstr</span><span>=</span><span>$returnstr</span><span>.substr(</span><span>$sourcestr</span><span>,</span><span>$i</span><span>,</span><span>1</span><span>)</span><span>;<br></span><span>            </span><span>$i</span><span>=</span><span>$i</span><span>+</span><span>1</span><span>;            </span><span>//实际的Byte数计1个<br></span><span>            </span><span>$n</span><span>=</span><span>$n</span><span>+</span><span>0.5</span><span>;        </span><span>//小写字母和半角标点等与半个高位字符宽...<br></span><span>        </span><span>}<br></span><span>    }<br></span><span>    </span><span>if </span><span>(</span><span>$n</span><span>&gt;</span><span>$cutlength</span><span>){<br></span><span>        </span><span>$returnstr </span><span>= </span><span>$returnstr </span><span>. </span><span>$suffix</span><span>;</span><span>//超过长度时在尾处加上省略号<br></span><span>    </span><span>}<br></span><span>    </span><span>return </span><span>$returnstr</span><span>;<br></span><span>}</span></pre>', '0', 2, '1', 0, '', 0, 0, 336, 1501031299, 1502067767, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (16, 5, 1, 'admin', 'CLTPHP操作开发手册已完全更新', 'CLTPHP操作开发手册已完全更新', 'CLTPHP操作开发手册已完全更新', '<p>CLTPHP操作开发手册已完全更新，CLTPHP核心价值，尽在其中。</p><p>喜欢的朋友可以购买参考</p><p>同时希望CLTPHP的爱好者，可以给我提出更多CLTPHP的不足之处，让CLTPHP更健康的成长。</p><p>手册地址：https://www.kancloud.cn/chichu/cltphp/</p>', '0', 2, '1', 0, '', 0, 0, 1895, 1501031404, 1502068026, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (17, 6, 1, 'admin', 'CLTPHP判断当前访问的用户是  PC端  还是 手机端', 'CLTPHP判断当前访问的用户是  PC端  还是 手机端', 'CLTPHP判断当前访问的用户是  PC端  还是 手机端', '<pre>/**\n&nbsp;*&nbsp;判断当前访问的用户是&nbsp;&nbsp;PC端&nbsp;&nbsp;还是&nbsp;手机端&nbsp;&nbsp;返回true&nbsp;为手机端&nbsp;&nbsp;false&nbsp;为PC&nbsp;端\n&nbsp;*&nbsp;&nbsp;是否移动端访问访问\n&nbsp;*&nbsp;@return&nbsp;boolean\n&nbsp;*/\nfunction&nbsp;isMobile()\n{\n&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;如果有HTTP_X_WAP_PROFILE则一定是移动设备\n&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(isset&nbsp;($_SERVER[&#39;HTTP_X_WAP_PROFILE&#39;]))\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;true;\n\n&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;如果via信息含有wap则一定是移动设备,部分服务商会屏蔽该信息\n&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(isset&nbsp;($_SERVER[&#39;HTTP_VIA&#39;]))\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;找不到为flase,否则为true\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;stristr($_SERVER[&#39;HTTP_VIA&#39;],&nbsp;&quot;wap&quot;)&nbsp;?&nbsp;true&nbsp;:&nbsp;false;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;脑残法，判断手机发送的客户端标志,兼容性有待提高\n&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(isset&nbsp;($_SERVER[&#39;HTTP_USER_AGENT&#39;]))\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$clientkeywords&nbsp;=&nbsp;array&nbsp;(&#39;nokia&#39;,&#39;sony&#39;,&#39;ericsson&#39;,&#39;mot&#39;,&#39;samsung&#39;,&#39;htc&#39;,&#39;sgh&#39;,&#39;lg&#39;,&#39;sharp&#39;,&#39;sie-&#39;,&#39;philips&#39;,&#39;panasonic&#39;,&#39;alcatel&#39;,&#39;lenovo&#39;,&#39;iphone&#39;,&#39;ipod&#39;,&#39;blackberry&#39;,&#39;meizu&#39;,&#39;android&#39;,&#39;netfront&#39;,&#39;symbian&#39;,&#39;ucweb&#39;,&#39;windowsce&#39;,&#39;palm&#39;,&#39;operamini&#39;,&#39;operamobi&#39;,&#39;openwave&#39;,&#39;nexusone&#39;,&#39;cldc&#39;,&#39;midp&#39;,&#39;wap&#39;,&#39;mobile&#39;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;从HTTP_USER_AGENT中查找手机浏览器的关键字\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(preg_match(&quot;/(&quot;&nbsp;.&nbsp;implode(&#39;|&#39;,&nbsp;$clientkeywords)&nbsp;.&nbsp;&quot;)/i&quot;,&nbsp;strtolower($_SERVER[&#39;HTTP_USER_AGENT&#39;])))\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;true;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;协议法，因为有可能不准确，放到最后判断\n&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(isset&nbsp;($_SERVER[&#39;HTTP_ACCEPT&#39;]))\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;如果只支持wml并且不支持html那一定是移动设备\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;如果支持wml和html但是wml在html之前则是移动设备\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;((strpos($_SERVER[&#39;HTTP_ACCEPT&#39;],&nbsp;&#39;vnd.wap.wml&#39;)&nbsp;!==&nbsp;false)&nbsp;&amp;&amp;&nbsp;(strpos($_SERVER[&#39;HTTP_ACCEPT&#39;],&nbsp;&#39;text/html&#39;)&nbsp;===&nbsp;false&nbsp;||&nbsp;(strpos($_SERVER[&#39;HTTP_ACCEPT&#39;],&nbsp;&#39;vnd.wap.wml&#39;)&nbsp;&lt;&nbsp;strpos($_SERVER[&#39;HTTP_ACCEPT&#39;],&nbsp;&#39;text/html&#39;))))\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;true;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;false;\n}</pre>', '0', 2, '1', 0, '', 0, 0, 350, 1501204163, 1552010140, 'CLTPHP', 'http://www.cltphp.com/', '', 'color:;font-weight:normal;', 'PC端,手机端');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (18, 3, 1, 'admin', '关于收费文档的误解', '关于收费文档的误解', '关于收费文档的误解', '<p>　　cltphp的文档收费20，靠20块文档赚钱，有点夸大了，定2000，万一有一个人付费，那就是100个20，也能算挣点小钱。</p><p>　　不花钱的东西，没有价值，也无所谓去骂娘。花了钱，大多人会去看，有价值的部分，自然会学习到。没价值的部分，一些人会骂娘，骂娘的同时，或许会说：这里怎样改一下不久好了嘛！对于这样的骂娘，我们很是支持。</p><p>　　另外赋上文档的初始态度：<a href=\"http://cltphp.com/newsInfo-16-5.html\" target=\"_self\" style=\"text-decoration: none;\"><strong>CLTPHP操作文档不断更新中</strong></a></p><h4><br/></h4>', '0', 2, '1', 0, '', 0, 0, 1390, 1501552272, 1505373009, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (19, 3, 1, 'admin', '关于捐赠的一些说明', '关于捐赠的一些说明', '关于捐赠的一些说明', '<p>首先非常感谢您对我们的支持。</p><p>近期发现，一部分朋友对我们捐赠时，并未留下名称或者其他称呼。</p><p>目前官网只接受微信扫码捐赠，所以，请您务必点击留言，留下您的大名，便于我们做捐赠名的展示。<img src=\"/public/uploads/20170904/a1bb03cea85aafd3bca3287ef3ade719.png\" alt=\"20170904/a1bb03cea85aafd3bca3287ef3ade719.png\"></p>', '0', 0, '1', 0, '', 0, 0, 536, 1501827480, 1504516379, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (20, 6, 1, 'admin', 'PHP格式化字节大小', 'PHP格式化字节大小', 'PHP格式化字节大小', '<pre><span>/**<br></span><span> * PHP格式化字节大小<br></span><span> * </span><span>@param  </span><span>number $size      字节数<br></span><span> * </span><span>@param  </span><span>string $delimiter 数字和单位分隔符<br></span><span> * </span><span>@return </span><span>string            格式化后的带单位的大小<br></span><span> */<br></span><span>function </span><span>format_bytes</span><span>(</span><span>$size</span><span>, </span><span>$delimiter </span><span>= </span><span>\'\'</span><span>) {<br></span><span>    </span><span>$units </span><span>= </span><span>array</span><span>(</span><span>\'B\'</span><span>, </span><span>\'KB\'</span><span>, </span><span>\'MB\'</span><span>, </span><span>\'GB\'</span><span>, </span><span>\'TB\'</span><span>, </span><span>\'PB\'</span><span>)</span><span>;<br></span><span>    </span><span>for </span><span>(</span><span>$i </span><span>= </span><span>0</span><span>; </span><span>$size </span><span>&gt;= </span><span>1024 </span><span>&amp;&amp; </span><span>$i </span><span>&lt; </span><span>5</span><span>; </span><span>$i</span><span>++) </span><span>$size </span><span>/= </span><span>1024</span><span>;<br></span><span>    </span><span>return </span><span>round(</span><span>$size</span><span>, </span><span>2</span><span>) . </span><span>$delimiter </span><span>. </span><span>$units</span><span>[</span><span>$i</span><span>]</span><span>;<br></span><span>}</span></pre>', '0', 1, '1', 0, '', 0, 0, 410, 1502067689, 1502067893, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (23, 3, 1, 'admin', '清除缓存和添加字段的错误修正方法', '清除缓存和添加字段的错误修正方法', '清除缓存和添加字段的错误修正方法', '<p>问题：</p><pre>Deprecated:&nbsp;Automatically&nbsp;populating&nbsp;$HTTP_RAW_POST_DATA&nbsp;is&nbsp;deprecated&nbsp;and&nbsp;will&nbsp;be&nbsp;removed&nbsp;in&nbsp;a&nbsp;future&nbsp;version.&nbsp;To&nbsp;avoid&nbsp;this&nbsp;warning&nbsp;set&nbsp;&#39;always_populate_raw_post_data&#39;&nbsp;to&nbsp;&#39;-1&#39;&nbsp;in&nbsp;php.ini&nbsp;and&nbsp;use&nbsp;the&nbsp;php://input&nbsp;stream&nbsp;instead.&nbsp;in&nbsp;Unknown&nbsp;on&nbsp;line&nbsp;0</pre><p><br/></p><p>修正方法：</p><p>去掉php.in配置文件always_populate_raw_post_data前面的分号</p><p><br/></p><p><br/></p>', '0', 0, '1', 0, '', 0, 0, 276, 1502761583, 1504763357, 'CLTPHP', 'http://www.cltphp.com/', '', '', '');
