INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (40, 6, 1, 'admin', 'php验证输入的邮件地址是否合法', 'php验证输入的邮件地址是否合法', 'php验证输入的邮件地址是否合法', '<pre class=\"brush:php;toolbar:false\">/**\n&nbsp;*&nbsp;验证输入的邮件地址是否合法\n&nbsp;*/\nfunction&nbsp;is_email($user_email)\n{\n&nbsp;&nbsp;&nbsp;&nbsp;$chars&nbsp;=&nbsp;&quot;/^([a-z0-9+_]|\\\\-|\\\\.)+@(([a-z0-9_]|\\\\-)+\\\\.)+[a-z]{2,6}\\$/i&quot;;\n&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(strpos($user_email,&nbsp;&#39;@&#39;)&nbsp;!==&nbsp;false&nbsp;&amp;&amp;&nbsp;strpos($user_email,&nbsp;&#39;.&#39;)&nbsp;!==&nbsp;false)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(preg_match($chars,&nbsp;$user_email))&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;true;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;else&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;false;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;else&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;false;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n}</pre><p><br/></p>', '0', 2, '1', 0, '', 0, 0, 176, 1505355407, 1552010115, 'CLTPHP', 'http://www.cltphp.com/', '', 'color:;font-weight:normal;', '邮箱验证');
