INSERT INTO `article` (`id`, `catid`, `userid`, `username`, `title`, `keywords`, `description`, `content`, `template`, `posid`, `status`, `recommend`, `readgroup`, `readpoint`, `sort`, `hits`, `createtime`, `updatetime`, `copyfrom`, `fromlink`, `thumb`, `title_style`, `tags`) VALUES (43, 6, 1, 'admin', '纯CSS实现页面的尖角、小三角、不同方向尖角的方法小结', '', '', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\">效果图：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\">方法一的效果图：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; text-align: center; background-color: rgb(255, 255, 255);\"><img src=\"/public/uploads/ueditor/image/20171008/1507425192923475.png\" alt=\"\"/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\">方法二的效果图：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; text-align: center; background-color: rgb(255, 255, 255);\"><img src=\"/public/uploads/ueditor/image/20171008/1507425192357806.png\" alt=\"\"/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\">方法三的效果图：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; text-align: center; background-color: rgb(255, 255, 255);\"><img src=\"/public/uploads/ueditor/image/20171008/1507425192288407.png\" alt=\"\"/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(255, 0, 0);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">方法1：因为有背景，所有实现起来比较方便，尖角的内部同个颜色就可以不用考虑遮挡问题</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">html:</span></p><pre class=\"brush:xhtml;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">&nbsp;&nbsp;带背景颜色的小三角实现是比较简单的！</pre><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">css</span></p><pre class=\"brush:sql;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">#top&nbsp;{&nbsp;&nbsp;\n&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;position:&nbsp;absolute;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;width:&nbsp;0px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;height:&nbsp;0px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;line-height:&nbsp;0px;/*为了防止ie下出现题型*/&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;border-bottom:&nbsp;10px&nbsp;solid&nbsp;#89b007;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;border-left:&nbsp;10px&nbsp;solid&nbsp;#fff;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;border-right:&nbsp;10px&nbsp;solid&nbsp;#fff;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;left:&nbsp;76px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;top:&nbsp;-10px;&nbsp;&nbsp;\n}&nbsp;&nbsp;\n#first&nbsp;{&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;border-radius:8px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;-moz-border-radius:8px;-ms-border-radius:8px;-o-border-radius:8px;-webkit-border-radius:8px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;position:&nbsp;absolute;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;height:&nbsp;150px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;width:&nbsp;300px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;background:&nbsp;#89b007;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;left:&nbsp;22px;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;top:&nbsp;33px;&nbsp;&nbsp;\n}&nbsp;&nbsp;\n#first&nbsp;p{&nbsp;padding:10px;&nbsp;line-height:1.5;&nbsp;color:#FFF;}</pre><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(255, 0, 0);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">方法2：</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">html</span></p><pre class=\"brush:xhtml;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;用面向对象的思想去书写css,用面向对象的心态去书写css。&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;◆&nbsp;◆</pre><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">css</span></p><pre class=\"brush:css;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">*&nbsp;{&nbsp;&nbsp;\nmargin:&nbsp;0;&nbsp;&nbsp;\npadding:&nbsp;0;&nbsp;&nbsp;\n}&nbsp;&nbsp;\na{&nbsp;color:#666;&nbsp;text-decoration:none;&nbsp;line-height:25px;&nbsp;text-indent:24px;}&nbsp;&nbsp;\n.w{&nbsp;width:200px;&nbsp;position:absolute;&nbsp;background:#999;&nbsp;left:400px;&nbsp;top:200px;&nbsp;font-size:12px;&nbsp;text-align:left}/*模拟灰色阴影背景层*/&nbsp;&nbsp;\n.x{&nbsp;width:180px;&nbsp;position:relative;&nbsp;background:#fff;&nbsp;&nbsp;border:1px&nbsp;solid&nbsp;#ccc;&nbsp;padding:10px;&nbsp;left:-4px;&nbsp;top:-4px;}/*内容div*/&nbsp;&nbsp;\n.y&nbsp;,&nbsp;.z{&nbsp;&nbsp;\nposition:&nbsp;absolute;&nbsp;&nbsp;\nleft:&nbsp;141px;&nbsp;&nbsp;\n}&nbsp;&nbsp;\n.y{&nbsp;&nbsp;\ncolor:&nbsp;#ccc;&nbsp;&nbsp;\nfont-size:&nbsp;19px;&nbsp;&nbsp;\ntop:-12px;&nbsp;&nbsp;\nz-index:1;&nbsp;&nbsp;\n}/*模拟小三角*/&nbsp;&nbsp;\n.z{&nbsp;&nbsp;\ncolor:&nbsp;#fff;&nbsp;&nbsp;\nfont-size:&nbsp;19px;&nbsp;&nbsp;\ntop:-11px;&nbsp;&nbsp;z-index:3;&nbsp;&nbsp;\n}/*模拟小三角*/</pre><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(255, 0, 0);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">方法3：</span></span></p><pre class=\"brush:xhtml;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;不管写什么内容，总之就是要实现无图小三角，要是有背景颜色那倒是极好的，没有的话也可以，就是稍微麻烦一点</pre><pre class=\"brush:css;\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow: auto; font-family: monospace, monospace; font-size: 1em; line-height: 1.42857; word-break: break-all; word-wrap: break-word; border: 1px solid rgb(204, 204, 204); border-radius: 4px; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); background-color: rgb(245, 245, 245);\">#content&nbsp;{&nbsp;&nbsp;\ntext-indent:&nbsp;2em;&nbsp;&nbsp;\nbox-shadow:&nbsp;0px&nbsp;0px&nbsp;10px&nbsp;#999;&nbsp;&nbsp;\npadding:&nbsp;10px;&nbsp;&nbsp;\nfont-size:&nbsp;12px;&nbsp;&nbsp;\nline-height:&nbsp;1.5;&nbsp;&nbsp;\nborder-radius:&nbsp;5px;&nbsp;&nbsp;\nheight:&nbsp;100px;&nbsp;&nbsp;\nwidth:&nbsp;250px;&nbsp;&nbsp;\nposition:&nbsp;relative;&nbsp;&nbsp;\nmargin:&nbsp;200px&nbsp;auto;&nbsp;&nbsp;\nborder:&nbsp;1px&nbsp;solid&nbsp;#CCC;&nbsp;&nbsp;\n}&nbsp;&nbsp;\nspan&nbsp;{&nbsp;&nbsp;\nposition:&nbsp;absolute;&nbsp;&nbsp;\nleft:&nbsp;25px;&nbsp;&nbsp;\nheight:&nbsp;0px;&nbsp;&nbsp;\nwidth:&nbsp;0px;&nbsp;&nbsp;\n}&nbsp;&nbsp;\n/*上部小三角实现样式开始*/&nbsp;&nbsp;\nspan.out&nbsp;{&nbsp;&nbsp;\nline-height:&nbsp;0;&nbsp;&nbsp;\nborder-width:&nbsp;10px;&nbsp;&nbsp;\nborder-color:&nbsp;transparent&nbsp;transparent&nbsp;#CCC&nbsp;transparent;&nbsp;&nbsp;\nborder-style:&nbsp;dashed&nbsp;dashed&nbsp;solid&nbsp;dashed;&nbsp;&nbsp;\ntop:&nbsp;-20px;&nbsp;&nbsp;\n}&nbsp;&nbsp;\nspan.iner&nbsp;{&nbsp;&nbsp;\nborder-width:&nbsp;10px;&nbsp;&nbsp;\nborder-color:&nbsp;#fff&nbsp;transparent&nbsp;#FFF&nbsp;transparent;&nbsp;&nbsp;\nborder-style:&nbsp;dashed&nbsp;dashed&nbsp;solid&nbsp;dashed;&nbsp;&nbsp;\ntop:&nbsp;-19px;&nbsp;&nbsp;\nline-height:&nbsp;0;&nbsp;&nbsp;\n}&nbsp;&nbsp;\n/*右部小三角实现样式开始*/&nbsp;&nbsp;\nspan.right&nbsp;{&nbsp;&nbsp;\nbackground:&nbsp;#FFF;&nbsp;&nbsp;\nborder-width:&nbsp;1px;&nbsp;&nbsp;\nwidth:&nbsp;16px;&nbsp;&nbsp;\nheight:&nbsp;16px;&nbsp;&nbsp;\nborder-color:&nbsp;#CCC&nbsp;#CCC&nbsp;transparent&nbsp;transparent;&nbsp;&nbsp;\nborder-style:&nbsp;solid&nbsp;solid&nbsp;dashed&nbsp;dashed;&nbsp;&nbsp;\nleft:&nbsp;270px;&nbsp;&nbsp;\ntop:&nbsp;30px;&nbsp;&nbsp;\nborder-radius:&nbsp;0&nbsp;0&nbsp;100%&nbsp;0;/*这里radius的值不要选取绝对值因为在放大或者缩小的过程中会产生封不住口的现象*/&nbsp;&nbsp;\nline-height:&nbsp;0;&nbsp;&nbsp;\nbox-shadow:&nbsp;5px&nbsp;0&nbsp;10px&nbsp;#aaa;&nbsp;&nbsp;\n}</pre><p><br/></p>', '0', 0, '1', 0, '', 0, 0, 104, 1507425169, 1552010090, 'CLTPHP', 'http://www.cltphp.com/', '', 'color:;font-weight:normal;', 'CSS');
